//SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

contract Voting {
    // uint256 public nextElectionId = 1;
    mapping(string => Election) elections;
    mapping(string => Candidate) candidates;

    mapping(address => Voter) voters;

    mapping(string => address[]) votedVoters;
    string[] public electionIdList;

    struct Election {
        string electionId;
        string electionName;
        address creatorId;
        string password;
        bool hasPassword;
        uint256 startDate;
        uint256 endDate;
        bool isActive;
        string[] candidates;
        string electionCover;
        address[] pendingVoter;
        address[] approvedVoter;
    }

    struct Candidate {
        string candidateId;
        string candidateName;
        string candidateImage;
        address[] voter;
    }

    struct Voter {
        address voterId;
    }
    event ElectionResult(
        string candidateId,
        uint256 voteCount,
        string candidateName
    );

    function getElectionResult(string memory electionId)
        public
        view
        returns (Candidate[] memory candidateResults)
    {
        Election storage election = elections[electionId];
        Candidate[] memory candidateList = new Candidate[](
            election.candidates.length
        );
        for (uint64 i = 0; i < election.candidates.length; i++) {
            Candidate storage candidate = candidates[election.candidates[i]];
            candidateList[i] = candidate;
        }
        return candidateList;
    }

    function getAllElectionId() public view returns (string[] memory) {
        return electionIdList;
    }

    function approveVoter(address voterId, string memory electionId) public {
        Election storage election = elections[electionId];
        for (uint64 i = 0; i < election.pendingVoter.length - 1; i++) {
            if (election.pendingVoter[i] == voterId) {
                election.pendingVoter[i] = election.pendingVoter[i + 1];
            }
        }
        election.pendingVoter.pop();
        election.approvedVoter.push(voterId);
    }

    function voteCandidate(
        string memory candidateId,
        address voterId,
        string memory electionId
    ) public {
        Candidate storage candidate = candidates[candidateId];
        candidate.voter.push(voterId);
        votedVoters[electionId].push(voterId);
        emit ElectionResult(
            candidateId,
            candidate.voter.length,
            candidate.candidateName
        );
    }

    function getAllElectionVoter(string memory electionId)
        public
        view
        returns (address[] memory)
    {
        return votedVoters[electionId];
    }

    function joinElection(string memory electionId, address voterId) public {
        Election storage election = elections[electionId];
        election.pendingVoter.push(voterId);
    }

    function addCandidate(
        string memory candidateId,
        string memory candidateName,
        string memory candidateImage
    ) public {
        Candidate storage newCandidate = candidates[candidateId];
        newCandidate.candidateId = candidateId;
        newCandidate.candidateName = candidateName;
        newCandidate.candidateImage = candidateImage;
    }

    function getCandidate(string memory candidateId)
        public
        view
        returns (Candidate memory)
    {
        return candidates[candidateId];
    }

    function registerUser(address voterId) public {
        Voter storage user = voters[voterId];
        user.voterId = voterId;
    }

    function getUser(address id) public view returns (Voter memory) {
        return voters[id];
    }

    function createElection(
        string memory electionId,
        string memory electionName,
        address creatorId,
        string memory password,
        bool hasPassword,
        uint256 startDate,
        uint256 endDate,
        bool isActive,
        string[] memory candidatesList,
        string memory electionCover,
        address[] memory pendingVoter,
        address[] memory approvedVoter
    ) public {
        Election storage newElection = elections[electionId];
        newElection.electionId = electionId;
        newElection.electionName = electionName;
        newElection.creatorId = creatorId;
        newElection.password = password;
        newElection.hasPassword = hasPassword;
        newElection.startDate = startDate;
        newElection.endDate = endDate;
        newElection.isActive = isActive;
        newElection.candidates = candidatesList;
        newElection.electionCover = electionCover;
        newElection.pendingVoter = pendingVoter;
        newElection.approvedVoter = approvedVoter;
        electionIdList.push(electionId);
    }

    function getAnElection(string memory id)
        public
        view
        returns (Election memory)
    {
        return elections[id];
    }
}
